{"metadata":{"kernelspec":{"language":"python","display_name":"Python 3","name":"python3"},"language_info":{"pygments_lexer":"ipython3","nbconvert_exporter":"python","version":"3.6.4","file_extension":".py","codemirror_mode":{"name":"ipython","version":3},"name":"python","mimetype":"text/x-python"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"code","source":"# %% [markdown] {\"id\":\"j_wZ17Ykrhxv\"}\n# # Getting into CNN with Image Classification\n\n# %% [markdown] {\"id\":\"dAVgnVraro8B\"}\n# ![th (1).jpeg](data:image/jpeg;base64,)\n# \n# <h4 style=\"color:red;\">In this Notebook we will see how to develop a CNN Model and understand the practical implementation of one the CNN architecture</h4>\n# \n\n# %% [markdown] {\"id\":\"wRDnpcAasCAo\"}\n# ## First of all What is CNN?\n\n# %% [markdown] {\"id\":\"EIVetXpYsIzy\"}\n# ![th.jpeg](data:image/jpeg;base64,)\n# \n# <div style=\"color:darkviolet;\">CNN stands for Convolutional Neural Network. It is a deep learning algorithm that is commonly used for analyzing visual data, such as images or videos. CNNs are specifically designed to process data with a grid-like structure, where the input is typically represented as a 2D matrix.\n# \n# The main idea behind CNNs is to apply a series of filters, known as convolutional layers, to the input data. These filters are designed to detect various features or patterns within the data, such as edges, corners, or textures. By stacking multiple convolutional layers, the network can learn increasingly complex features.\n# \n# The convolutional layers are typically followed by pooling layers, which reduce the spatial dimensions of the data and help extract the most salient information. Pooling layers aggregate the output of nearby neurons and downsample the data, reducing its dimensionality while preserving important features.</div>\n\n# %% [markdown] {\"id\":\"2xiwIpBHueXu\"}\n# # Importing the Requirements\n\n# %% [markdown] {\"id\":\"Oq0uvTm5utNW\"}\n# ## Importing required Libraries\n\n# %% [code] {\"id\":\"Sv482I1GWZVG\"}\nimport os\nimport warnings\nwarnings.filterwarnings(\"ignore\")\nimport numpy as np\nimport pandas as pd\nimport matplotlib.pyplot as plt\nimport seaborn as sns\nimport tensorflow as tf\nfrom tensorflow import keras\nfrom tensorflow.keras import Sequential , layers\n\n# %% [markdown] {\"id\":\"jWDMFjytvET_\"}\n# <div style=\"color:red;\">Importing the Dataset is the base thing for such process.\n# So we importing the Dataset from Kaggle with Kaggle api</div>\n\n# %% [markdown] {\"id\":\"Iq3HTM9Xvd89\"}\n# **Kaggle API** is best for such datasets which are larger to import to Notebooks\n\n# %% [markdown] {\"id\":\"qqIyfMVhvvY8\"}\n# <div style=\"color:red;\">This will help to load the dataset directly to the notebook without time and cloud storage loss</div>\n\n# %% [code] {\"id\":\"p2r374YLjcw6\"}\n!mkdir -p ~/.kaggle\n!cp kaggle.json ~/.kaggle/\n!chmod 600 ~/.kaggle/kaggle.json\n\n# %% [markdown] {\"id\":\"KEkrH93xwCv1\"}\n# Try importing Kaggle API with above lines of code and make sure you'have  connected to your kaggle account by Kaggle generated **API key in json format**\n\n# %% [markdown] {\"id\":\"8X93pTzAwfiP\"}\n# <div style=\"color:blue;\">Keep your Kaggle credential Key Safe by not sharing to anyone</div>\n\n# %% [code] {\"id\":\"V4tf7TXJXZse\",\"outputId\":\"842c2ab3-13df-4e88-ac5a-aad643e52bd5\"}\n!kaggle datasets download -d forderation/breakhis-400x\n\n# %% [markdown] {\"id\":\"XJ2Ae1NAwr2Y\"}\n# <div style=\"color:blue;\">For This notebook we will classify whether the image is malignant or benign in BreakHis 400X Dataset which is even available in Kaggle</div>\n# \n# ![th (2).jpeg](data:image/jpeg;base64,)\n\n# %% [markdown] {\"id\":\"-Ifk4YzNxU9l\"}\n# # Extracting and Preprocessing\n\n# %% [markdown] {\"id\":\"Z_VSsNpJxdo5\"}\n# ## Extracting ZIP\n\n# %% [markdown] {\"id\":\"7Bak5pqixgWg\"}\n# Our Dataset is loaded as ZIP\n\n# %% [markdown] {\"id\":\"NUcElM6RxnXw\"}\n# we need to extract the zip file so we use ZipFile module to extract it\n\n# %% [code] {\"id\":\"Vti5XoxhYfe4\",\"outputId\":\"62abab81-2980-40dc-f052-50bea141d9c4\"}\nfrom zipfile import ZipFile\n\nzip_file = \"/content/breakhis-400x.zip\"\n\nwith ZipFile(zip_file,\"r\")as zip:\n  zip.extractall()\n  print(\"Unzipped Successfully!...\")\n\n# %% [markdown] {\"id\":\"4ynwUb2MxzkU\"}\n# ## Preprocessing the image\n\n# %% [markdown] {\"id\":\"YoCrzFWJyIL2\"}\n# ![th (3).jpeg](data:image/jpeg;base64,)\n# \n# \n# <div style=\"color:red;\">When training a CNN model, you cannot directly load the image as raw pixel values because the neural network expects input in a specific format. Here are a few reasons why images need to be preprocessed before feeding them into a CNN:</div>\n# \n# <div style=\"color:blue;\">Size and Resolution: Images in a dataset can have varying sizes and resolutions. CNN models typically require fixed-size inputs. Therefore, the images need to be resized to a consistent size, such as 224x224 pixels or 32x32 pixels, depending on the architecture and requirements of the CNN model.\n# \n# Normalization: It is common to normalize the pixel values of an image before feeding them into a CNN. Normalization helps in achieving numerical stability and ensures that the features have a similar scale. Typically, pixel values are scaled to a range of 0 to 1 or -1 to 1.</div>\n\n# %% [code] {\"id\":\"ei9jxs5VZxqr\"}\nimport tensorflow_hub as hub\nfrom tensorflow.keras.preprocessing.image import ImageDataGenerator\nfrom tensorflow.keras.applications import ResNet50\nfrom tensorflow.keras.applications.resnet50 import preprocess_input\n\n# %% [markdown] {\"id\":\"KIWec3bPzJCH\"}\n# <div style=\"color:blue;\">Color Channels: Images can have different color representations, such as grayscale, RGB (Red, Green, Blue), or even more complex color spaces. CNN models usually expect a specific number of color channels. For example, RGB images have three channels. Grayscale images are often expanded to have three channels with the same values in each channel.\n# \n# Data Format: CNN models typically expect the input data to be in a specific format, such as a 4D tensor. The dimensions of the tensor correspond to the number of samples, image height, image width, and number of channels. Therefore, images need to be reshaped to match the required input format.</div>\n# \n# <div style=\"color:red;\">By preprocessing the images before training, you ensure that they are in a consistent format that the CNN model can understand and process effectively. This preprocessing step helps the model learn meaningful features from the images and improves its ability to make accurate predictions.</div>\n\n# %% [code] {\"id\":\"-BF5wA7aaoCx\",\"outputId\":\"54dd58d5-36c5-4bd9-fac6-47077a3b3876\"}\ntarget = (224,224)\nbatch = 64\n\ngenerator = ImageDataGenerator(preprocessing_function=tf.keras.applications.resnet50.preprocess_input,rescale=1/255)\n\ntraingen = generator.flow_from_directory(\"/content/BreaKHis 400X/train/\",target_size=target,\n                                         batch_size=batch,\n                                         color_mode=\"rgb\",\n                                         class_mode=\"binary\")\n\ntestgen = generator.flow_from_directory(\"/content/BreaKHis 400X/test/\",target_size=target,\n                                        batch_size=batch,\n                                        color_mode=\"rgb\",\n                                        class_mode=\"binary\")\n\n# %% [code] {\"id\":\"tyKxSHSvc7Cz\",\"outputId\":\"5338f6da-24ee-4ec7-a63a-25c4dbd4b7fe\"}\nlabel_info = traingen.class_indices\nlabel_info\n\n# %% [markdown] {\"id\":\"BnRCJtMmzTyP\"}\n# # Inception of the Model\n\n# %% [markdown] {\"id\":\"sO5d0NOjzajl\"}\n# we gonna use Resnet 50 for this model which is one the famous CNN architecture\n\n# %% [markdown] {\"id\":\"X505w7gkzwXd\"}\n# ![th (4).jpeg](data:image/jpeg;base64,)\n# \n# \n# <div style=\"color:darkviolet;\">ResNet-50 is a deep convolutional neural network architecture that was introduced by Microsoft Research in 2015. It is part of the ResNet (Residual Network) family of models, which are known for their exceptional performance in image recognition and classification tasks.\n# \n# The \"50\" in ResNet-50 refers to the number of layers in the network. It consists of a total of 50 layers, including convolutional layers, pooling layers, fully connected layers, and shortcut connections known as residual connections. Residual connections are a key innovation in ResNet architectures and help address the problem of vanishing gradients during training.</div>\n\n# %% [code] {\"id\":\"mnD7Ro-ddROu\"}\nbase_layer = tf.keras.applications.ResNet50(\n    include_top=False,\n    weights=\"imagenet\",\n    input_tensor=None,\n    input_shape=(224,224,3),\n    pooling=None,\n)\n\nmodel = Sequential([\n    base_layer,\n    layers.Flatten(),\n    layers.Dense(512,activation=\"relu\"),\n    layers.BatchNormalization(),\n    layers.Dense(1024,activation=\"relu\"),\n    layers.Dropout(0.45),\n    layers.BatchNormalization(),\n    layers.Dense(2048,activation=\"relu\"),\n    layers.Dropout(0.4),\n    layers.BatchNormalization(),\n    layers.Dense(1024,activation=\"relu\"),\n    layers.Dropout(0.35),\n    layers.BatchNormalization(),\n    layers.Dense(1,activation=\"sigmoid\")\n])\n\n# %% [markdown] {\"id\":\"UhgPaxFP0Qpb\"}\n# we get some insights about our model by using method called summary\n\n# %% [markdown] {\"id\":\"dPBmqz_A0a6P\"}\n# This summarize the layers of our model\n\n# %% [code] {\"id\":\"REc-VRRDgvgi\",\"outputId\":\"9b26b704-b020-4930-dd26-25fd6abef0b2\"}\nmodel.summary()\n\n# %% [markdown] {\"id\":\"EonDQyt20kPd\"}\n# Then we are compiling our model with some optimizers , loss functions and Metrics\n# \n# ![th (5).jpeg](data:image/jpeg;base64,)\n\n# %% [code] {\"id\":\"6hHpvT6cgZrj\"}\nfrom tensorflow.keras import optimizers\nmodel.compile(\n    optimizer = optimizers.Adam(learning_rate=0.00075),\n    loss = \"binary_crossentropy\",\n    metrics = [\"accuracy\"],\n)\n\n# %% [code] {\"id\":\"bBP4Eyg-sVcD\"}\nfrom keras.callbacks import ReduceLROnPlateau\nreduce_lr = ReduceLROnPlateau(monitor = 'val_loss', patience = 1, verbose = 1, factor = 0.25, mode=\"min\")\n\n# %% [code] {\"id\":\"c6ydE43Shed9\",\"outputId\":\"11c977a1-2c99-40b9-a3c0-d895550b982d\"}\nhistory = model.fit(\n    traingen,\n    batch_size=64,\n    epochs=10,\n    verbose=1,\n    validation_data=testgen,\n    callbacks = [reduce_lr]\n)\n\n# %% [markdown] {\"id\":\"xCDvyKHA1IH5\"}\n# ## Plotting our Results\n\n# %% [markdown] {\"id\":\"JzXkwHVQ1IGg\"}\n# This will help us to get visualize what happened with such CNN model\n# \n# \n\n# %% [code] {\"id\":\"bYFw-l9WzQu4\",\"outputId\":\"e580a2bf-8119-4da3-b298-71b253342dd5\"}\nplt.figure(figsize=(15,7))\nplt.subplot(1,2,1)\nplt.plot(history.history['accuracy'])\nplt.plot(history.history['val_accuracy'])\n\n# %% [code] {\"id\":\"rxMpp8Q2z9ML\",\"outputId\":\"41a74022-ce0c-4538-ed28-4c60683ca839\"}\nplt.figure(figsize=(15,7))\nplt.subplot(1,2,1)\nplt.plot(history.history['loss'])\nplt.plot(history.history['val_loss'])\n\n# %% [code] {\"id\":\"9AlHZeYAvGCg\"}\n'''import h5py\nimport gzip\nmodel.save(\"BH-CNN-model.h5\",include_optimizer=False)'''\n\n# %% [code] {\"id\":\"ywaYmZqHzvcx\"}\n#!cp \"/content/BH-CNN-model.h5\" \"/content/drive/MyDrive/ocr_datafile/\"","metadata":{"_uuid":"862f0869-959e-46c5-a5ca-44bcd094ee27","_cell_guid":"b92d76c6-ab54-4e88-87be-75ce3989826b","collapsed":false,"jupyter":{"outputs_hidden":false},"trusted":true},"execution_count":null,"outputs":[]}]}